/**
 * @title IMPRESSION D'UN TICKET PDF
 * @description Impression d'un ticket PDF
 * @service ReceiptPrinting (ReceiptPrinter)
 */

let pdf = ''


/**
 * lancement de l'impression d'un ticket PDF
 */
function start1() {
    console.log("START - Impression d'un ticket PDF");
    Kiosk.ReceiptPrinting.addEventListener('rawPdfPrint', onPdfPrint);
    Kiosk.ReceiptPrinting.printRawPdf({
        "raw": pdf
      })
}

function onPdfPrint(e) {
    switch (e.data.dataType) {
        case 'PdfPrinted':
            console.log("END - Ticket PDF imprimé");
            Kiosk.ReceiptPrinting.removeEventListener('rawPdfPrint', onPdfPrint);
            break;
        case 'PdfPrintError':
            console.error(e.data.code + ": " + e.data.description);
            // Le cas Timout est à traiter comme un cas fonctionnel dégradé
            if (e.data.code == 'Timeout') {
                console.log("ERROR Ticket PDF imprimé, sans détection de la fin d'impression");
            }
            break;
    }
}

function stop1(){
    console.log("STOP - Impression d'un ticket PDF");
    Kiosk.ReceiptPrinting.removeEventListener('rawPdfPrint', onPdfPrint);
}